import React from "react";
import { Link } from "react-router-dom";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFaceBook, faCoffee, faPinterest } from '@fortawesome/free-solid-svg-icons';

import {
  Nav,
  Col,
  Image
} from 'react-bootstrap';

export default function FooterNav() {

  return (
      <Nav className='container-fluid d-flex justify-content-center text-center text-white bg-dark' >
            <Col>

            <div className="">

              <Link className="btn btn-outline-light m-4" href="#"><FontAwesomeIcon icon={faCoffee} /></Link>

              <Link className="btn btn-outline-light m-4" href="#"><svg icon="fab fa-instagram"></svg></Link>

              <Link className="btn btn-outline-light m-4" href="#" width=""><Image src="https://i.pinimg.com/originals/78/ec/58/78ec584ad22b96232ef581f0ee7fdb1f.jpg" width=""/></Link>

              <Link className="btn btn-outline-light m-4" href="#"><i className="faPinterest"></i></Link>
            </div>
            </Col>
     </Nav>
  );
}


